import React from 'react';
import './PeltierCoolingSection.css';

const ZenPositionSection: React.FC = () => {
  return (
    <section className="peltier-cooling-section">
      <div className="peltier-cooling-content">
        <h2 className='peltier-cooling-title'>PELTIER COOLING</h2>
        <p>Achieve your ideal comfort with advanced Peltier cooling technology. Whether you prefer a cool or warm environment, our temperature regulation system ensures a perfect balance for your relaxation needs.</p>
        <ul>
          <li>Dynamic temperature control for maximum comfort</li>
          <li>Energy-efficient Peltier cooling system</li>
          <li>Quick adjustments to suit personal preferences</li>
          <li>Helps maintain optimal body temperature during rest</li>
        </ul>
      </div>
      <div className="peltier-cooling-image">
        <div className="image-frame">
          <img src={process.env.PUBLIC_URL + '/'} alt="Zen Position Demonstration" />
        </div>
      </div>
    </section>
  );
};

export default ZenPositionSection;
